import ItemVitrine from '../itemVitrine';


function Vitrine({ produtos }) {
    return (
        <div className="produtos">
            <div className="products">
                {produtos.map((item) =>
                    <ItemVitrine key={item.id} product={item} />
                )}
            </div>
        </div>
    );

}


export default Vitrine
